import React  from "react";


export function Nav(){
    const [MenuNav, setMenuNav] = React.useState({
        "id":"Hola Mundo"
    });

    return(
        <React.StrictMode>
            <ul>
                <li>{setMenuNav[0]}</li>
            </ul>
        </React.StrictMode>
    )
}
